sys_variable_value.value:
(function execute(inputs, outputs) {
    var pubSub = new GooglePubsubUtils();
    pubSub.validateInputVariables(inputs, outputs);
    pubSub.validateMandatoryVariables(inputs, ["projectid", "subscription", "maxMessages"]);
    pubSub.maptoOutputFromInput(inputs, outputs, ["projectid", "subscription"]);
    var payload = JSON.stringify({
        "maxMessages": inputs.maxMessages,
        "returnImmediately": inputs.returnImmediately || false
    });
    outputs.payload = payload;
})(inputs, outputs);

