sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.statusCode != "200") {
        new GCPPubSubErrorHandling().subscriptionErrorHandling(inputs, outputs);
        return;
    }
    outputs.status = "Success";
    outputs.messages = JSON.parse(inputs.responseBody).receivedMessages;
})(inputs, outputs);

